import './Topbar.css';

const Submenu = () => {
    return (
        <div class = "sub_menu">
            <a href = "" rel="noreferrer">Menu</a>
        </div>
    )
}

const Topbar = () => {
    return (
        <div class = "topbar">
            <div class = "logo"></div>
            <Submenu/>
            <Submenu/>
        </div>
    );
}

export default Topbar;
